import styled from 'styled-components';
import { ReactComponent as Wave } from '../../assets/wave.svg';

export const Waves = styled(Wave)`
	display: block;
	width: 100%;
	/* height: 100px; */
	.rect {
		fill: ${(props) => props.theme.contrastLight};
		width: 100%;
		height: 100%;
		color: white;
	}
	.wave1 {
		fill: ${(props) => props.theme.contrastDark};
	}
`;
